@import "../../assets/less/uikit";
@dark: #141B1F;




.exchange {
  width: 100vw;
  height: 100vh;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  color: #fff;
  overflow: hidden;
  image-rendering: optimizeQuality;
  display: flex;
  align-items: center;
  position: absolute;
  background-color: #141B1FF0;

  ::-webkit-scrollbar {
    display: none;
  }
  input::-webkit-outer-spin-button,
  input::-webkit-inner-spin-button {
    -webkit-appearance: none;
    margin: 0;
  }

  p {
    margin: 0;
    padding: 0;
  }

  &-left {
    width: @733px;
    height: 100vh;
    background-color: #141B1F;
    padding: 0 @200px;
    position: relative;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;

    &__boxesTop {
      position: absolute;
      pointer-events: none;
      top: 0;
      left: 0;
      width: 100%;
    }

    &__boxesBottom {
      position: absolute;
      pointer-events: none;
      bottom: 0;
      right: 0;
      width: @194px;
    }

    &__exchangeImage {
      width: @120px;
      margin-bottom: @30px;
    }

    &-buttons {
      width: @432px;
      height: @64px;
      display: flex;
      justify-content: space-between;

      .exchange-forReady {
        background-color: #8CAE01 !important;
        opacity: 1 !important;

        span {
          display: none;
        }

        p {
          display: block;
        }
      }

      .exchange-forConfirm {
        background-color: #F04D26 !important;
        opacity: 1 !important;

        span {
          display: block;
        }

        p {
          display: none;
        }
      }

      div {
        display: flex;
        justify-content: center;
        align-items: center;
        font-size: @16px;
        border-radius: @4px;
        height: 100%;
        opacity: .8;

        &:hover {
          opacity: 1;
        }
      }

      img {
        margin-right: @11px;
        width: @24px;
      }

      &__accept {
        width: @246px;
        background-color: #F04D26;

        p {
          display: none;
        }
      }

      &__cancel {
        width: @172px;
        background-color: #FFFFFF1a;

        p {
          display: none;
        }
      }
    }

    &__h1 {
      margin: @50px auto 0 0;
      font-size: @24px;
    }

    &__title {
      margin: @34px auto 0 0;
      font-size: @16px;
      opacity: .6;
    }

    &-slots {
      margin-top: @16px;
      display: grid;
      min-height: @168px;
      max-height: @185px;
      grid-gap: @8px;
      grid-template-columns: repeat(5, @80px);
      grid-template-rows: repeat(2, @80px);
      overflow-y: auto;

      .allow-interactions {
        &:hover {
          background: rgba(255, 255, 255, 0.16);
          transition: background-color 200ms linear;
        }
      }

      div {
        min-height: @80px;
        background-color: #FFFFFF0F;
        position: relative;
        border-radius: @4px;
        display: flex;
        justify-content: center;
        align-items: center;

        img {
          width: @50px;
        }

        span {
          position: absolute;
          bottom: @8px;
          right: @8px;
          font-size: @14px;
        }
      }
    }

    &-input {
      display: flex;
      margin-top: @20px;
      width: 100%;
      height: @60px;
      border: @1px solid #fff6;
      box-sizing: border-box;
      border-radius: @4px;
      align-items: center;

      img {
        width: @24px;
        margin: 0 @18px 0 @24px;
        pointer-events: none;
      }

      input, span {
        color: #fff !important;
        opacity: .6 !important;
        font-size: @14px;
        border: none;
        outline: none;
        background: none;
      }
    }
  }
}

.body-inventory {
  position: relative;
  background-size: cover;
  height: 100vh;
  font-size: @18px;
  font-weight: 400;
  line-height: 1;
  color: #fff;
  overflow: hidden;

  button.br4 {
    color: #fff;
  }
  img {
    pointer-events: none;
    user-select: none;
  }
  button {
    border: 0;
    margin: 0;
    padding: 0;
    cursor: pointer;
    outline: none;
  }
}

.anim {
  transition: all 0.33s ease-in-out;
  -webkit-transition: all 0.33s ease-in-out;
  -moz-transition: all 0.33s ease-in-out;
}

.upper {
  text-transform: uppercase;
}

.animlong {
  transition: all 0.5s ease-in-out;
  -webkit-transition: all 0.5s ease-in-out;
  -moz-transition: all 0.5s ease-in-out;
}

.br4 {
  border-radius: @4px;
}



.tc {
  text-align: center;
}

.ls-01 {
  letter-spacing: 0.1em;
}

.p-44px {
  font-size: @44px;
}

.p-18px {
  font-size: @18px;
}

.p-16px {
  font-size: @16px;
}

.p-14px {
  font-size: @14px;
}

.fsi {
  font-style: italic;
}

.fw800 {
  font-weight: 800;
}

.fw700 {
  font-weight: 700;
}

.fw500 {
  font-weight: 500;
}

.fw400 {
  font-weight: 400;
}

.fw300 {
  font-weight: 300;
}

.dark {
  color: @dark;
}

