  color: rgba(255, 255, 255, 0.6);
}

.fff-04 {
  color: rgba(255, 255, 255, 0.4);
}

.fff-02 {
  color: rgba(255, 255, 255, 0.2);
}

.lh180 {
  line-height: 1.8;
}

