.storage {
  min-width: @733px;
  height: 100vh;
  padding: @50px 0;
  overflow: auto;
  position:static;
  padding-right: @60px;

  &::-webkit-scrollbar {
    width: 0 !important;
  }
  * {
    &::-webkit-scrollbar {
      width: 0 !important;
    }
  }

  &::-webkit-scrollbar-track {
    background: transparent;
  }

  &::-webkit-scrollbar-thumb {
    background-color: transparent;
  }

  &::-webkit-scrollbar-thumb:window-inactive {
    background-color: transparent;
  }

  & > div {
    width: 100%;
    margin-bottom: @24px;

    &:last-of-type {
      margin-bottom: 0;
    }
  }
}

.dashed-border {
  border: @2px dashed rgba(255, 255, 255, 0.06);
}

.solid-border {
  border: @2px dashed rgba(255, 255, 255, 0.06);
}

.noborder-darkbg {
