.inventory-item-main-grid {
  display: grid;
  grid-gap: @8px;
  margin-top: @20px;


  &.fr7 {
    grid-template-columns: repeat(7, 1fr);
  }

  &.fr5 {
    grid-template-columns: repeat(5, 1fr);
  }

  &.fr2 {
    grid-template-columns: repeat(2, 1fr);
  }

  &.h256 {
    max-height: @256px;
    overflow: auto;
    position:static;
  }

  &.h432 {
    max-height: @432px;
    overflow: auto;
    position:static;

  }

  &.h80 {
    max-height: @80px;
    overflow: auto;
    position:static;

  }

  &::-webkit-scrollbar {
    width: 0;
  }

  &::-webkit-scrollbar-track {
    background: transparent;
  }

  &::-webkit-scrollbar-thumb {
    background-color: transparent;
  }

  &::-webkit-scrollbar-thumb:window-inactive {
    background-color: transparent;
  }
}
