.inventory-item-main-wrap {
  width: @80px;
  height: @80px;
  .fl-row-aic-jcc;
  background: rgba(255, 255, 255, 0.06);
  .anim;

  .img-wrap {
    width: @50px;
    height: @50px;

    img {
      width: 100%;
      height: 100%;
      object-fit: cover;
    }
  }

  i.count {
    position: absolute;
    bottom: @8px;
    right: @8px;
    text-align: right;
  }
}

.in-inventory-item-main-wrap {
  position: relative;
  width: @80px;
  height: @80px;
  .fl-row-aic-jcc;
  cursor: pointer;
  .anim;

  &.take-it {
    transform: rotate(15deg);
    position: absolute;
    background: rgba(255, 255, 255, 0.16);
    box-shadow: @24px @24px @24px rgba(0, 0, 0, 0.4);

  }

  .img-wrap {
    width: @50px;
    height: @50px;

    img {
      width: 100%;
      height: 100%;
      object-fit: cover;
    }
  }

  i.count {
    position: absolute;
    bottom: @8px;
    right: @8px;
    text-align: right;
  }

  &:hover {
    background: rgba(255, 255, 255, 0.16);
  }
}

.extra-inventory-item-main-wrap {
  padding: @9px;
  position: absolute;
  z-index: 200;
  box-shadow: @24px @24px @30px rgba(81, 81, 81, 0.25);

  .storage-wrap {
    display: block;
  }

  &:after {
    content: '';
    display: block;
    position: absolute;
    bottom: -@5px;
    left: 50%;
    transform: translateX(-50%);
    background: url(./images/svg/extra-dark-arrow.svg) no-repeat center center;
    background-size: cover;
    width: @11px;
    height: 0.2864583333333333vw;
  }

  .inventory-item-main-grid {
    margin-top: @4px;
  }
}

