.num-capacity {
  .fl-row-aic-je;
  transform: rotate(-90deg);
  height: @157px;

  p {
    position: relative;
    margin-right: @23px;

    &:after {
      content: '/';
      display: block;
      position: absolute;
      right: -@16px;
      top: 50%;
      transform: translateY(-50%);
      font-size: @18px;
      font-weight: 700;
      .upper;
      .fff-04;
      .ls-01;
    }

    &:last-of-type {
      &:after {
        display: none;
      }
    }
  }
}

