.mini-modal-menu-wrap {
  margin-top: @4px;
  box-shadow: @24px @24px @24px rgba(0, 0, 0, 0.4);
  max-height: @310px;
  overflow: auto;
  position:static;
  li {
    border: 0;
    background-color: #fff;
    .fl-row-aic-jcs;
    padding: @10px;
    padding-right: @18px;
    cursor: pointer;
    margin-bottom: 0;
    .anim;

    &.lock {

      object,
      p {
        opacity: .6;
      }
    }

    &:first-of-type {
      border-radius: @4px @4px 0 0;
    }

    &:last-of-type {
      border-radius: 0 0 @4px @4px;
    }

    &:nth-child(odd) {
      background: #F2F2F2;
    }

    &:hover {
      &:not(.lock){
        background-color: #F2C94C;
      }
    }

    img {
      width: @32px;
      height: @32px;
      margin-right: @10px;
    }
  }
}

.modal-increasing-capacity-inventory-wrapper {
  .fl-row-aic-jcc;
  display: none;
  background: rgba(240, 77, 38, 0.9);
  position: absolute;
  left: 0;
  top: 0;
  width: 100%;
  height: 100%;
  z-index: 999;

  &.active {
    display: -webkit-flex;
    display: -moz-flex;
    display: -ms-flex;
    display: -o-flex;
    display: flex;
  }

  .modal-increasing-capacity-inventory-wrap {
    position: relative;
    width: @1116px;
    height: @684px;
    .fl-row-aic-jcc;
    background: url(./images/bg-modal.png) no-repeat center center;
    background-size: cover;

    .close {
      .fl-row-aic-jcc;
      cursor: pointer;
      position: absolute;
      right: 0;
      top: 0;
      width: @104px;
      height: @104px;

      &:hover {
        img {
          transform: rotate(90deg);
        }
      }

      img {
        width: @24px;
        height: @24px;
        .anim;
      }
    }

    .img-wrap {
      width: @511px;
      height: @506px;

      img {
        width: 100%;
        height: 100%;
        object-fit: cover;
      }
    }

    p {
      width: @386px;

      &:last-of-type {
        margin-top: @18px;
      }
    }

    button {
      .fl-row-aic-jcc;
      display: inline-flex;
      padding: @17px @24px;
      background-color: #F04D26;
      margin-top: @36px;
      box-shadow: 0px 0px 40px rgba(240, 77, 38, 0);
      .anim;

      &:hover {
        box-shadow: 0 0 40px rgba(240, 77, 38, 0.3);
      }

      img {
        margin-right: @16px;
        width: @24px;
        height: @24px;
      }

      p {
        width: auto;
        margin: 0 !important;
      }
    }
  }
}


