.inventory-battlePass {
  width: @432px;
  height: @80px;
  border-radius: @4px;
  display: flex;
  flex-direction: column;
  align-items: center;
  padding-top: @14px;
  position: relative;
  margin: -@20px auto;
  filter: brightness(.7);
  transition: .15s;

  &:hover {
    filter: brightness(1);
    box-shadow: 0 0 @15px #fff1;
  }

  * {
    text-transform: uppercase !important;
    color: #fff !important;
    z-index: 1;
  }

  &__title {
    font-size: @33px !important;
    line-height: 90% !important;
    text-shadow: 0 0 @10px #000000;
    margin-bottom: @7px;
  }

  &__text {
    font-size: @16px !important;
    line-height: 111% !important;
  }

  img {
    position: absolute;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    z-index: 0;
  }
}
